import React from "react";
import { Container, Col, Row } from "shards-react";

import PageTitle from "../components/common/PageTitle";

export default function Home() {
  return (
    <Container fluid className="main-content main-content-container px-0">
      <div className="d-flex justify-content-center bg-white py-3 header-navbar sticky-top">
        <img
          id="main-logo"
          className="d-inline-block align-middle mx-auto"
          style={{ maxWidth: "200px" }}
          src={require("../images/logo-1200.png")}
          alt="workcradle"
        />
      </div>
      <Col
        style={{ height: "80vh" }}
        className="d-flex justify-content-center pt-4"
      >
        <Row
          noGutters
          className="page-header py-4 bg-white"
          style={{ width: "80%", maxWidth: "506px", minHeight: "300px" }}
        >
          <h1>Welcome!</h1>
          <PageTitle
            className="d-block"
            sm="4"
            title="Continue as"
            subtitle=""
            className="text-sm-left"
          />
          <Row>
            <Col className="col-lg 6 col-md-12 col-sm-12">
              <img
                id="dietician-avatar"
                className="d-inline-block align-middle mx-auto b-50"
                // style={{ maxWidth: "200px" }}
                src={require("../images/avatars/portrait.jpg")}
                alt="workcradle"
              />
            </Col>
            <Col className="col-lg 6 col-md-12 col-sm-12">
              <img
                id="patient-avatar"
                className="d-inline-block align-middle mx-auto"
                // style={{ maxWidth: "200px" }}
                src={require("../images/avatars/portrait.jpg")}
                alt="workcradle"
              />
            </Col>
          </Row>
        </Row>
      </Col>
    </Container>
  );
}
